    controls { forwarding }
    description "testing for pool extraction function"
    requires { http }
    rules {
        css_pool_rule {
            actions {
                0 {
                    forward
                    select
                    pool /Common/css_pool
                }
            }
            conditions {
                0 {
                    http-uri
                    scheme
                    ends-with
                    values { .css }
                }
            }
        }
        jpg_pool_rule {
            actions {
                0 {
                    forward
                    select
                    pool /Common/jpg.pool
                }
            }
            conditions {
                0 {
                    http-uri
                    query-string
                    ends-with
                    values { .jpg }
                }
            }
            ordinal 1
        }
        js_pool_rule {
            actions {
                0 {
                    forward
                    select
                    pool /Common/js.io_t80_pool
