                    ends-with
                    values { .js }
                }
            }
            ordinal 2
        }
        txt_node {
            actions {
                0 {
                    forward
                    select
                    node 10.10.10.1
                }
            }
            conditions {
                0 {
                    http-uri
                    scheme
                    ends-with
                    values { .txt }
                }
            }
            ordinal 3
        }
    }
    strategy /Common/first-match
